function ({ip}, {location}) {
  const url = `https://ipapi.co/${ip}/json/`;
  return fetch(url)
    .then((response) => response.json())
    .then((data) => {
      const { city, region, country_name } = data;
      location.next(`${city}, ${region}, ${country_name}`);
    });
}
